UserConnection userConnection = Get<UserConnection>("UserConnection");
if (Get<bool>("IsPaid"))
{
	var сontractId=Get<Guid>("ContractId");
	var esqInvoice = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "Invoice");
	esqInvoice.AddAllSchemaColumns();
	var esqInvoiceFilter1 = esqInvoice.CreateFilterWithParameters(FilterComparisonType.Equal, nameof(Invoice.Contract), сontractId);
	var esqInvoiceFilter2 = esqInvoice.CreateFilterWithParameters(FilterComparisonType.Equal, nameof(Invoice.NsIsPaid), true);
	esqInvoice.Filters.Add(esqInvoiceFilter1);
	esqInvoice.Filters.Add(esqInvoiceFilter2);
	EntityCollection entityInvoice = esqInvoice.GetEntityCollection(UserConnection);
	var sumInvoice=0;
	if (entityInvoice.IsNotEmpty()) 
	{
	    foreach (var item in entityInvoice) 
	    {
	    	sumInvoice += Convert.ToInt32(item.GetColumnValue(nameof(Invoice.Amount)));
	    }
    }
    var esqContract = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "Contract");
	esqContract.AddAllSchemaColumns();
	var esqContractFilter = esqContract.CreateFilterWithParameters(FilterComparisonType.Equal, nameof(Contract.Id), сontractId);
	esqContract.Filters.Add(esqContractFilter);
	EntityCollection entityContract = esqContract.GetEntityCollection(UserConnection);
	var amountContract=0;
	if (entityContract.IsNotEmpty()) 
	{
	    foreach (var item in entityContract)
	    {
	    	amountContract += Convert.ToInt32(item.GetColumnValue(nameof(Contract.Amount)));
	    	var contactId = item.GetColumnValue(nameof(Contract.ContactId));
	    	var number = item.GetColumnValue(nameof(Contract.Number));
	    	var contractDate = item.GetColumnValue(nameof(Contract.NsDate));
	    	var factAmount = item.GetColumnValue(nameof(Contract.NsFactAmount));
	    	Set ("ContactId", contactId);
	    	Set ("Number", number);
	    	Set ("ContractDate", number);
	    	Set ("FactAmount", factAmount);
	    }
	}
	var entity = esqContract.GetEntity(UserConnection, сontractId);
	entity.SetColumnValue("NsFactAmount", sumInvoice);
    if (sumInvoice>=amountContract)
    {
    	entity.SetColumnValue("NsIsPaid", true);
    }
    entity.Save();
}
return true;
